import React from 'react'

const Card = ({data}) => {
  return (
    <>
     <div sty className="card" style={{ width: "16rem" }}>
        
          
          { <img
            height={300}
            src={data.image}
            className="card-img-top"
            alt="..."
          />}
        
        <div className="card-body">
          <h5 className="card-title">{data.title}</h5>
          <p className="card-text fs-5"> RS {data.price}</p>
          <p className='fs-6'>{data.rating.rate}</p>
          <p>{data.rating.count}</p>
          
        </div>
      </div> 
    </>
  )
}

export default Card
